/*Table structure for table `st_feedback` */

DROP TABLE IF EXISTS `st_feedback`;

CREATE TABLE `st_feedback` (
  `id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `title` varchar(255) DEFAULT NULL,
  `company` varchar(255) DEFAULT NULL,
  `website` varchar(255) DEFAULT NULL,
  `thumbnail` varchar(255) DEFAULT NULL,
  `content` tinytext DEFAULT NULL,
  `vote` tinyint(5) DEFAULT 5,
  `is_status` tinyint(1) NOT NULL DEFAULT 1,
  `created_time` datetime NOT NULL DEFAULT current_timestamp(),
  `updated_time` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `st_feedback` */

insert  into `st_feedback`(`id`,`name`,`title`,`company`,`website`,`thumbnail`,`content`,`vote`,`is_status`,`created_time`,`updated_time`) values (1,'Mr. Tài',NULL,'Tú Tài Mobile',NULL,'feedback/10439326_1589883114604919_7403067575992810411_n-150x150.jpg','\'\'Thích ở Thành Chi là sự nhiệt tình mỗi khi mua hàng, rồi bảo hành cũng ok luôn. Làm ăn với Thành Chi tôi rất yên tâm. Điểm 10 cho chất lượng\'\'',5,1,'2018-11-24 01:58:20','2018-11-24 01:58:46'),(2,'Mr. Quý',NULL,'Quý Dậu Mobile',NULL,'feedback/quy-dau-mobile-150x150.jpg','\'\'Tôi đã hợp tác với LPK Thành Chi đã hơn 5 năm, sản phẩm linh kiện đầy đủ đa dạng, đáp ứng được trên 80% yêu cầu của tôi. Như vậy là rất chuyên nghiệp. Hy vọng Thành Chi cập nhật nhiều mẫu ph',5,1,'2018-11-24 01:59:20','2018-11-24 01:59:21'),(3,'Ms. Hương',NULL,'Hương Mobile',NULL,'feedback/12141522_844709232317234_7125096605076712849_n-150x150.jpg','\'\'Mình thấy rất yên tâm mỗi khi mua sản phẩm tại Thành Chi, Bên mình chuyên ép kính nên rất cần những sản phẩm chất lượng. Ngày đầu hợp tác còn e dè vì ở xa, nhưng đến bây giờ 60% lượng hàng hóa',5,1,'2018-11-24 02:03:54','2018-11-24 02:03:54');

/*Table structure for table `st_groups` */

