/*Table structure for table `st_order` */

DROP TABLE IF EXISTS `st_order`;

CREATE TABLE `st_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `phone` varchar(45) DEFAULT NULL,
  `full_name` varchar(255) DEFAULT NULL,
  `email` varchar(200) DEFAULT NULL,
  `is_status` tinyint(6) DEFAULT 1 COMMENT 'Bắt buộc 0: Hủy đơn hàng 1:đơn hàng chờ sử lý 2:Chưa xác nhận thanh toán  3: Đã xác nhận 4 : đang vận chuyển ERP 5 : đã giao hàng ERP ',
  `total_amount` float NOT NULL COMMENT 'tổng thanh toán',
  `note` text NOT NULL,
  `bill_address` varchar(255) DEFAULT NULL COMMENT 'Địa chỉ viết hóa đơn',
  `shipped_time` date DEFAULT NULL,
  `voucher_id` int(11) DEFAULT NULL,
  `xaphuong` int(11) DEFAULT NULL,
  `city_id` int(11) DEFAULT NULL,
  `district_id` int(11) DEFAULT NULL,
  `payment` tinyint(1) DEFAULT 1 COMMENT '1: COD',
  `domain` varchar(255) DEFAULT NULL,
  `updated_time` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `created_time` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=117 DEFAULT CHARSET=utf8;

