/*Table structure for table `st_page_translations` */

DROP TABLE IF EXISTS `st_page_translations`;

CREATE TABLE `st_page_translations` (
  `id` int(11) unsigned NOT NULL,
  `language_code` varchar(2) NOT NULL,
  `slug` varchar(255) NOT NULL,
  `title` varchar(255) NOT NULL,
  `description` mediumtext NOT NULL,
  `content` longtext DEFAULT NULL,
  `meta_title` varchar(100) NOT NULL,
  `meta_description` varchar(170) NOT NULL,
  `meta_keyword` varchar(255) DEFAULT NULL,
  UNIQUE KEY `ap_page_translations_id_language_code_pk` (`id`,`language_code`),
  FULLTEXT KEY `title` (`title`),
  CONSTRAINT `fk_page_trans_pageid` FOREIGN KEY (`id`) REFERENCES `st_page` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `st_page_translations` */

insert  into `st_page_translations`(`id`,`language_code`,`slug`,`title`,`description`,`content`,`meta_title`,`meta_description`,`meta_keyword`) values (1,'vi','lien-he','Liên hệ','Liên hệ','<p>Li&ecirc;n hệ</p>','Liên hệ','Liên hệ','Liên hệ'),(2,'vi','dieu-kien-va-chinh-sach-dai-ly','Điều kiện và chính sách đại lý','Điều kiện và chính sách đại lý','<p>Với mong muốn mở rộng ph&aacute;t triển thị trường linh - phụ kiện điện thoại, với thiện ch&iacute; hỗ trợ v&agrave; hợp t&aacute;c với những đơn vị kinh doanh tr&ecirc;n to&agrave;n quốc.&nbsp;<strong>Zin linh kiện<em>&nbsp;</em></strong>tuyển đại l&yacute; tr&ecirc;n to&agrave;n quốc với những gi&aacute; trị v&agrave; ưu đ&atilde;i hấp dẫn nhất.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Quyền lợi của kh&aacute;ch h&agrave;ng khi gia nhập đại l&yacute; Zin linh kiện</strong></p>\r\n<p>Chiết khấu hấp dẫn: để tạo điều kiện hỗ trợ tốt nhất về vốn cho c&aacute;c đơn vị kinh doanh trở th&agrave;nh đại l&yacute; đưa sản phẩm phụ kiện điện thoại <strong>Zin linh kiện</strong> rộng r&atilde;i khắp thị trường cả nước, <strong>Zin linh kiện</strong> lu&ocirc;n gi&agrave;nh mức chiết khấu v&agrave; ưu đ&atilde;i hấp dẫn nhất.</p>\r\n<p><strong>Cung cấp h&agrave;ng ch&iacute;nh h&atilde;ng 100% sản xuất hoặc ph&acirc;n ph&ocirc;́i đ&ocirc;̣c quy&ecirc;̀n từ Zin linh kiện</strong></p>\r\n<ul>\r\n<li>Sản phẩm được cấp ph&eacute;p lưu h&agrave;nh to&agrave;n quốc, đạt chứng nhận ti&ecirc;u chuẩn an to&agrave;n v&agrave; chất lượng.</li>\r\n<li>Cung cấp đến đại l&yacute; to&agrave;n bộ t&agrave;i liệu, th&ocirc;ng số kỹ thuật ti&ecirc;u chuẩn li&ecirc;n quan đến c&aacute;c sản phẩm Zin linh kiện.</li>\r\n<li>Xuất h&oacute;a đơn, chứng từ h&agrave;ng h&oacute;a đầy đủ khi nhập h&agrave;ng l&agrave;m đại l&yacute;.</li>\r\n<li>Hỗ trợ đại l&yacute; trong việc quảng b&aacute; thương hiệu, &yacute; tưởng thiết kế bảng hiệu, baner, tờ rơi hoặc quảng c&aacute;o trực tiếp l&ecirc;n website ch&iacute;nh của c&ocirc;ng ty nhằm th&uacute;c đẩy quảng c&aacute;o rộng r&atilde;i sản phẩm đến kh&aacute;ch h&agrave;ng.</li>\r\n<li>&Aacute;p dụng nhiều chương tr&igrave;nh khuyến mại hấp dẫn cho nh&agrave; ph&acirc;n phối v&agrave; đại l&yacute;, những ch&iacute;nh s&aacute;ch khuyến kh&iacute;ch đại l&yacute; b&aacute;n h&agrave;ng bằng c&aacute;c phần thưởng n&oacute;ng theo doanh số.</li>\r\n</ul>\r\n<p>Mọi th&ocirc;ng tin chi tiết v&agrave; muốn được tư vấn cụ thể xin li&ecirc;n hệ trực tiếp Hotline:&nbsp;<strong>099.999.9999</strong>&nbsp;để được hỗ trợ.</p>\r\n<p><strong>(Địa chỉ văn ph&ograve;ng: 103/469 Nguyễn Tr&atilde;i, Thanh Xu&acirc;n, H&agrave; Nội)</strong></p>','Điều kiện và chính sách đại lý','Điều kiện và chính sách đại lý','Điều kiện và chính sách đại lý'),(3,'vi','gia-dai-ly-va-uu-dai','Giá đại lý và ưu đãi','Giá đại lý và ưu đãi','<p>Gi&aacute; đại l&yacute; v&agrave; ưu đ&atilde;i</p>','Giá đại lý và ưu đãi','Giá đại lý và ưu đãi','Giá đại lý và ưu đãi'),(4,'vi','ve-chung-toi','Về chúng tôi','Giới thiệu về công ty Zin Việt Nam','<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; background: white;\"><span style=\"color: #333333;\">Bắt đầu bước v&agrave;o thị trường v&agrave;o năm 2018, với những cố gắng thay đổi ch&iacute;nh m&igrave;nh, <strong>C&ocirc;ng ty TNHH Zin Việt Nam</strong>&nbsp;đ&atilde; trở th&agrave;nh một doanh nghiệp tư nh&acirc;n hoạt động trong lĩnh cung cấp c&aacute;c linh phụ kiện điện thoại, ipad,&hellip;<o:p></o:p></span></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; background: white;\"><span style=\"color: #333333;\">Trong bối cảnh cạnh tranh khốc liệt như hiện nay, để c&oacute; thể tồn tại v&agrave; ph&aacute;t triển kh&ocirc;ng ngừng, Zin Việt Nam đ&atilde; li&ecirc;n tục nỗ lực để mang đến cho kh&aacute;ch h&agrave;ng những giải ph&aacute;p c&ocirc;ng nghệ tối ưu. Với mục ti&ecirc;u đưa kh&aacute;ch h&agrave;ng đến gần với ch&uacute;ng t&ocirc;i hơn, Zin Việt Nam lu&ocirc;n đặt m&igrave;nh v&agrave;o vị tr&iacute; người mua để thấu hiểu những nhu cầu, thị hiếu của người sử dụng. Ch&iacute;nh v&igrave; vậy, những trang thiết bị được ch&uacute;ng t&ocirc;i lựa chọn ph&acirc;n phối hầu hết l&agrave; những sản phẩm c&oacute; thương hiệu, chất lượng, uy t&iacute;n v&agrave; tr&ecirc;n hết l&agrave; v&ocirc; c&ugrave;ng &ldquo;độc lạ&rdquo;.</span><o:p></o:p></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; background: white; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0);\"><span style=\"color: #333333;\">Kh&ocirc;ng dừng lại ở đ&oacute;, c&ugrave;ng với sự ph&aacute;t triển nhanh ch&oacute;ng thị trường thiết bị di động. Ch&uacute;ng t&ocirc;i lu&ocirc;n lu&ocirc;n tự cập nhật, trang bị, l&agrave;m mới ch&iacute;nh m&igrave;nh để c&oacute; thể hỗ trợ một c&aacute;ch tốt nhất cho người d&ugrave;ng smartphone. C&aacute;c sản phẩm linh kiện điện thoại được Zin linh kiện cung ứng lu&ocirc;n được đảm bảo về chất lượng, gi&aacute; cả v&agrave; ch&iacute;nh s&aacute;ch sau b&aacute;n h&agrave;ng hợp l&yacute;.</span><o:p></o:p></span></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; background: white;\"><span style=\"color: #333333;\"><o:p>&nbsp;</o:p></span></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; background: white; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0);\"><em style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0);\"><b><span style=\"color: darkorange;\">ĐỘI NGŨ NH&Acirc;N VI&Ecirc;N TẬN T&Acirc;M, CHUY&Ecirc;N NGHIỆP</span></b></em><span style=\"color: #333333;\"><o:p></o:p></span></span></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; background: white; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0);\"><span style=\"color: #333333;\">Đến với&nbsp;<strong style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">Zin linh kiện</strong>, bạn c&ograve;n nhận được những sự hỗ trợ, tư vấn tận t&igrave;nh từ c&aacute;c nh&acirc;n vi&ecirc;n b&aacute;n h&agrave;ng, nh&acirc;n vi&ecirc;n kỹ thuật. B&ecirc;n cạnh hệ thống hỗ trợ offline, ch&uacute;ng t&ocirc;i lu&ocirc;n cố gắng ho&agrave;n thiện v&agrave; n&acirc;ng cao chất lượng của đội ngũ tư vấn vi&ecirc;n chăm s&oacute;c kh&aacute;ch h&agrave;ng online. Tạo điều kiện để mang đến những điều tốt nhất cho kh&aacute;ch h&agrave;ng th&acirc;n y&ecirc;u của m&igrave;nh.</span><o:p></o:p></span></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; background: white; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0);\"><span style=\"color: #333333;\">B&ecirc;n cạnh c&aacute;c đối t&aacute;c vận chuyển chuy&ecirc;n nghiệp, uy t&iacute;n. Zin linh kiện cũng tự x&acirc;y dựng cho m&igrave;nh đội ngũ shipper th&acirc;n thiện, năng động, c&oacute; kỹ năng tốt. Hỗ trợ kh&aacute;ch h&agrave;ng tr&ecirc;n mọi miền đất nước, giao h&agrave;ng nhanh ch&oacute;ng, tiết kiệm thời gian cũng như tạo sự an t&acirc;m v&agrave; sự tin tưởng ở kh&aacute;ch h&agrave;ng.</span><o:p></o:p></span></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; background: white; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0);\"><em style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0);\"><b><span style=\"color: darkorange;\"><o:p>&nbsp;</o:p></span></b></em></span></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; background: white;\"><em><b><span style=\"color: darkorange;\">PHƯƠNG CH&Acirc;M HOẠT ĐỘNG</span></b></em><span style=\"color: #333333;\"><o:p></o:p></span></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; background: white; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0);\"><span style=\"color: #333333;\">L&agrave; một c&ocirc;ng ty hoạt động ch&iacute;nh tr&ecirc;n lĩnh vực dịch vụ,&nbsp;<em style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">Zin linh kiện </em>&nbsp;nhận thức được tầm quan trọng v&agrave; vai tr&ograve; của kh&aacute;ch h&agrave;ng đối với sự tồn tại, ph&aacute;t triển của c&ocirc;ng ty. Ch&iacute;nh v&igrave; vậy, tất cả những g&igrave; c&ocirc;ng ty hướng đến l&agrave; sự h&agrave;i l&ograve;ng, quan t&acirc;m của qu&yacute; kh&aacute;ch h&agrave;ng gần xa. Đảm bảo sao cho những trải nghiệm mua sắm tại Zin linh kiện lu&ocirc;n l&agrave; những trải nghiệm tuyệt vời nhất cho qu&yacute; kh&aacute;ch.</span><o:p></o:p></span></p>','Về chúng tôi','Về chúng tôi','Về chúng tôi'),(5,'vi','dieu-khoan-dich-vu','Điều khoản dịch vụ','Điều khoản dịch vụ','<ol id=\"recently-viewed-items\">\r\n<li class=\"item even\"><a href=\"/dieu-khoan-dich-vu.html\" title=\"Điều khoản dịch vụ\">Điều khoản dịch vụ</a></li>\r\n</ol>','Điều khoản dịch vụ','Điều khoản dịch vụ','Điều khoản dịch vụ'),(6,'vi','ho-tro-khach-hang','Hỗ trợ khách hàng','Hỗ trợ khách hàng','<p class=\"hotline-number\"><strong>C&ocirc;ng Ty TNHH Zin Việt Nam</strong></p>\r\n<p class=\"hotline-number\">Trụ sở ch&iacute;nh:<strong>&nbsp;<em>241 L&ecirc; Lợi, Minh Khai, TP Phủ L&yacute;, H&agrave; Nam</em></strong></p>\r\n<p class=\"hotline-number\">Địa chỉ văn ph&ograve;ng:&nbsp;<em><strong>103/469 Nguyễn Tr&atilde;i, Thanh Xu&acirc;n, H&agrave; Nội</strong></em></p>\r\n<p class=\"hotline-number\">Hotline hỗ trợ: 1900-299-922</p>\r\n<p class=\"hotline-number\">Thời gian l&agrave;m việc: từ 08h - 19h, T2 - T7</p>\r\n<p class=\"hotline-number\"></p>\r\n<div class=\"nav-list\"><a href=\"http://hotro.tiki.vn/hc/vi\" target=\"_blank\" rel=\"nofollow noopener noreferrer\"></a>Email:&nbsp;support@zinlinhkien.com.vn</div>','Hỗ trợ khách hàng','Hỗ trợ khách hàng','Hỗ trợ khách hàng'),(7,'vi','chinh-sach-bao-hanh','Chính sách bảo hành','Chính sách bảo hành của Zin linh kiện','<p></p>\r\n<p><strong>Đối với sản phẩm m&agrave;n h&igrave;nh, cảm ứng, thiết bị sửa chữa</strong></p>\r\n<p>- Bảo h&agrave;nh 06 th&aacute;ng kể từ thời điểm b&aacute;n</p>\r\n<p>- Chấp nhận bảo h&agrave;nh với những điều kiện sau:</p>\r\n<p><em>+ Sản phẩm c&ograve;n tem m&aacute;c của Zin linh kiện</em></p>\r\n<p><em>+ Sản phẩm kh&ocirc;ng bị gẫy gập, hư hỏng, h&igrave;nh dạng kh&ocirc;ng c&ograve;n như l&uacute;c ban đầu</em></p>\r\n<p><em>+ Cổ c&aacute;p m&agrave;n h&igrave;nh, cảm ứng kh&ocirc;ng bị hỏng, đứt g&atilde;y hay bất cứ l&yacute; do g&igrave; l&agrave;m hư hỏng c&aacute;p</em></p>\r\n<p>- Từ chối bảo h&agrave;nh với những l&yacute; do sau:</p>\r\n<p><em>+ Qu&aacute; hạn bảo h&agrave;nh</em></p>\r\n<p><em>+ Kh&ocirc;ng c&oacute; tem hoặc kh&ocirc;ng phải tem của Zin linh kiện</em></p>\r\n<p><em>+ Tem m&aacute;c hư hỏng, hoặc c&oacute; dấu hiệu chỉnh sửa th&ocirc;ng tin tr&ecirc;n tem</em></p>\r\n<p><em>+ Sản phẩm kh&ocirc;ng c&ograve;n như l&uacute;c ban đầu</em></p>\r\n<p><strong>Đối với sản phẩm phụ kiện</strong></p>\r\n<p>- Bảo h&agrave;nh 12 th&aacute;ng kể từ thời điểm b&aacute;n</p>\r\n<p>- Chấp nhận bảo h&agrave;nh với những điều kiện sau:</p>\r\n<p><em>+ Sản phẩm c&ograve;n tem m&aacute;c của Zin linh kiện</em></p>\r\n<p><em>+ Sản phẩm kh&ocirc;ng bị gẫy gập, hư hỏng, h&igrave;nh dạng kh&ocirc;ng c&ograve;n như l&uacute;c ban đầu</em></p>\r\n<p><em>+ Sản phẩm chưa qua sử dụng m&agrave; chỉ test đ&atilde; thấy lỗi</em></p>\r\n<p>- Từ chối bảo h&agrave;nh với những l&yacute; do sau:</p>\r\n<p><em>+ Qu&aacute; hạn bảo h&agrave;nh</em></p>\r\n<p><em>+ Kh&ocirc;ng c&oacute; tem hoặc kh&ocirc;ng phải tem của Zin linh kiện</em></p>\r\n<p><em>+ Tem m&aacute;c hư hỏng, hoặc c&oacute; dấu hiệu chỉnh sửa th&ocirc;ng tin tr&ecirc;n tem</em></p>\r\n<p><em>+ Sản phẩm kh&ocirc;ng c&ograve;n như l&uacute;c ban đầu</em></p>\r\n<p><em>+ Đ&atilde; qua sử dụng, sản phẩm bị ố bẩn, sứt mẻ</em></p>','Chính sách bảo hành','Chính sách bảo hành','Chính sách bảo hành'),(8,'vi','chinh-sach-doi-tra-san-pham','Chính sách đổi trả sản phẩm','Quy định đổi trả hàng hóa','<p></p>\r\n<h3>H&agrave;ng h&oacute;a đ&atilde; mua C&ocirc;ng ty kh&ocirc;ng c&oacute; tr&aacute;ch nhiệm phải nhập lại cho kh&aacute;ch h&agrave;ng.<o:p></o:p></h3>\r\n<h3>Trường hợp h&agrave;ng bảo h&agrave;nh của kh&aacute;ch h&agrave;ng đ&atilde; hết tại kho hoặc v&igrave; l&yacute; do x&aacute;c thực của kh&aacute;ch h&agrave;ng, C&ocirc;ng ty sẽ xử l&yacute; như sau:<o:p></o:p></h3>\r\n<p>- Ho&agrave;n lại tiền cho kh&aacute;ch h&agrave;ng theo đ&uacute;ng gi&aacute; trị b&aacute;n trong thời gian 10 ng&agrave;y kể từ ng&agrave;y mua h&agrave;ng.<o:p></o:p></p>\r\n<p>- Ho&agrave;n lại tiền cho kh&aacute;ch h&agrave;ng nhưng trừ 10% gi&aacute; trị sản phẩm nếu thời gian qu&aacute; 10 ng&agrave;y l&agrave;m việc v&agrave; kh&ocirc;ng qu&aacute; 20 ng&agrave;y.<o:p></o:p></p>\r\n<p>- Ho&agrave;n lại tiền cho kh&aacute;ch h&agrave;ng theo gi&aacute; trị thời điểm hiện tại nếu thời gian trả h&agrave;ng qu&aacute; 20 ng&agrave;y. Hoặc trừ 15% gi&aacute; trị nếu sản phẩm kh&ocirc;ng c&oacute; biến động gi&aacute; hoặc biến động gi&aacute; &iacute;t hơn 10%.<o:p></o:p></p>\r\n<p>- Đổi sang sản phẩm kh&aacute;c c&oacute; gi&aacute; trị tương đương nếu thời gian đổi trả kh&ocirc;ng qu&aacute; 10 ng&agrave;y.<o:p></o:p></p>\r\n<p>- Chờ sản phẩm về lại kho v&agrave; sẽ chuyển giao cho kh&aacute;ch h&agrave;ng trong thời gian sớm nhất.<o:p></o:p></p>\r\n<address>Mọi quy định về đổi trả h&agrave;ng &aacute;p dụng to&agrave;n C&ocirc;ng ty, đề nghị Qu&yacute; kh&aacute;ch h&agrave;ng tu&acirc;n thủ quy định để việc hợp t&aacute;c được thuận lợi. Xin cảm ơn!<o:p></o:p></address>','Chính sách đổi trả sản phẩm','Chính sách đổi trả sản phẩm','Chính sách đổi trả sản phẩm'),(9,'vi','chinh-sach-bao-mat-thong-tin','Chính sách bảo mật thông tin','Chính sách bảo mật thông tin','<p>Qu&yacute; kh&aacute;ch đang rất quan t&acirc;m đến những th&ocirc;ng tin c&aacute; nh&acirc;n khi cung cấp cho&nbsp;<strong>Zin linh kiện</strong>&nbsp;sẽ được bảo mật v&agrave; sử dụng như thế n&agrave;o. Ch&uacute;ng t&ocirc;i rất tr&acirc;n trọng sự tin tưởng của qu&yacute; kh&aacute;ch đ&atilde; d&agrave;nh cho c&ocirc;ng ty v&agrave; cam kết c&aacute;c th&ocirc;ng tin tr&ecirc;n sẽ được ho&agrave;n to&agrave;n bảo mật, kh&ocirc;ng tiết lộ cho b&ecirc;n thứ ba.</p>\r\n<p>Để c&oacute; thể hiểu r&otilde; hơn những cam kết của ch&uacute;ng t&ocirc;i, qu&yacute; kh&aacute;ch vui l&ograve;ng xem bản&nbsp;<strong><em>&ldquo;Ch&iacute;nh s&aacute;ch bảo mật th&ocirc;ng tin&rdquo;</em></strong>&nbsp;dưới đ&acirc;y:</p>\r\n<ol>\r\n<li><strong> Mục đ&iacute;ch v&agrave; phạm vi thu thập th&ocirc;ng tin.</strong></li>\r\n</ol>\r\n<p>&nbsp;&nbsp; &nbsp;Khi truy cập v&agrave; sử dụng c&aacute;c dịch vụ tại&nbsp;<strong>Zin linh kiện</strong>, qu&yacute; kh&aacute;ch sẽ được y&ecirc;u cầu đăng k&yacute; t&agrave;i khoản với c&aacute;c th&ocirc;ng tin c&aacute; nh&acirc;n như: họ t&ecirc;n, địa chỉ email, ng&agrave;y sinh, giới t&iacute;nh, số điện thoại li&ecirc;n hệ, &hellip; Mọi th&ocirc;ng tin khai b&aacute;o đều phải ch&iacute;nh x&aacute;c v&agrave; hợp ph&aacute;p để đảm quyền lợi cho qu&yacute; kh&aacute;ch khi sử dụng dịch vụ.&nbsp;Đồng thời, <strong>Zin linh kiện</strong>&nbsp;sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm trước ph&aacute;p luật c&aacute;c th&ocirc;ng tin m&agrave; qu&yacute; kh&aacute;ch đ&atilde; đăng k&yacute;.</p>\r\n<ol start=\"2\">\r\n<li><strong> Phạm vi sử dụng th&ocirc;ng tin c&aacute; nh&acirc;n:</strong></li>\r\n</ol>\r\n<p>C&aacute;c th&ocirc;ng tin của kh&aacute;ch h&agrave;ng được thu thập th&ocirc;ng qua trang web&nbsp;<u><a href=\"http://www.zinlinhkien.com.vn\">www.zinlinhkien.com.vn</a></u>&nbsp;sẽ được ch&uacute;ng t&ocirc;i d&ugrave;ng để:</p>\r\n<p>- Hỗ trợ kh&aacute;ch h&agrave;ng khi sử dụng c&aacute;c sản phẩm, dịch vụ tại zin linh kiện.</p>\r\n<p>- Giải đ&aacute;p thắc mắc li&ecirc;n quan cho kh&aacute;nh h&agrave;ng.</p>\r\n<p>- Thực hiện c&aacute;c cuộc khảo s&aacute;t kh&aacute;ch h&agrave;ng.<br> - Quảng c&aacute;o về c&aacute;c sản phẩm v&agrave; dịch vụ của&nbsp;<strong>Zin linh kiện</strong>.</p>\r\n<p>Tất cả c&aacute;c th&ocirc;ng tin c&aacute; nh&acirc;n của qu&yacute; kh&aacute;ch được ch&uacute;ng t&ocirc;i sử dụng với mục đ&iacute;ch ph&ugrave; hợp v&agrave; tu&acirc;n thủ đ&uacute;ng nội dung của &ldquo;Ch&iacute;nh s&aacute;ch bảo mật th&ocirc;ng tin&rdquo; n&agrave;y. &nbsp;Ch&uacute;ng t&ocirc;i c&oacute; thể d&ugrave;ng c&aacute;c th&ocirc;ng tin n&agrave;y để li&ecirc;n hệ với kh&aacute;ch h&agrave;ng dưới c&aacute;c h&igrave;nh thức như: x&aacute;c nhận đặt h&agrave;ng, thư cảm ơn, c&aacute;c th&ocirc;ng tin về kỹ thuật v&agrave; bảo mật. Ngo&agrave;i ra, bạn c&oacute; thể nhận được c&aacute;c th&ocirc;ng