 T&agrave;i Khoản :&nbsp;<strong>48210000394946</strong>&nbsp;&ndash; BIDV chi nh&aacute;nh H&agrave; Nam</p>\r\n<p>-&nbsp;<strong>Ng&acirc;n h&agrave;ng ACB</strong> - Số T&agrave;i Khoản :&nbsp;<strong>197915879</strong>&nbsp;&ndash; ACB chi nh&aacute;nh H&agrave; Nam</p>\r\n<p>-&nbsp;<strong>Ng&acirc;n h&agrave;ng Vietcombank</strong> - Số T&agrave;i Khoản :&nbsp;<strong>0901000048087&nbsp;</strong>- Vietcombank chi nh&aacute;nh H&agrave; Nam</p>\r\n<p>-&nbsp;<strong>Ng&acirc;n h&agrave;ng Agibank</strong> - Số T&agrave;i Khoản :&nbsp;<strong>2900205034272</strong>&nbsp;- Agibank chi nh&aacute;nh H&agrave; Nam</p>\r\n<p>-&nbsp;<strong>Ng&acirc;n h&agrave;ng Sacombank</strong>&nbsp;- Số T&agrave;i Khoản :&nbsp;<strong>030029078307</strong> Sacombank chi nh&aacute;nh H&agrave; Nam</p>\r\n<p>-&nbsp;<strong>Ng&acirc;n h&agrave;ng Đ&ocirc;ng &Aacute; Bank&nbsp;</strong>- Số T&agrave;i Khoản :&nbsp;<strong>0110057267</strong>&nbsp;Đ&ocirc;ng &Aacute; Bank chi nh&aacute;nh H&agrave; Nam</p>\r\n<p>-&nbsp;<strong>Ng&acirc;n h&agrave;ng Maritime bank </strong>- Số T&agrave;i Khoản :&nbsp;<strong>16001011009605</strong>&nbsp;Maritime bank chi nh&aacute;nh H&agrave; Nam</p>\r\n<p>&nbsp;</p>','Hướng dẫn cách thức mua hàng','Hướng dẫn cách thức mua hàng','Hướng dẫn cách thức mua hàng');

/*Table structure for table `st_post` */

DROP TABLE IF EXISTS `st_post`;

CREATE TABLE `st_post` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `thumbnail` varchar(255) DEFAULT NULL,
  `url_video` varchar(255) DEFAULT NULL,
  `is_status` tinyint(2) unsigned NOT NULL DEFAULT 1 COMMENT 'trang thai',
  `is_featured` tinyint(1) NOT NULL DEFAULT 0,
  `displayed_time` datetime DEFAULT NULL COMMENT 'ngay publish',
  `viewed` int(11) unsigned NOT NULL DEFAULT 0,
  `created_time` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'ngay tao',
  `updated_time` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'ngay sua',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

/*Data for the table `st_post` */

insert  into `st_post`(`id`,`thumbnail`,`url_video`,`is_status`,`is_featured`,`displayed_time`,`viewed`,`created_time`,`updated_time`) values (2,'san-pham/Pin-cac-loai/pin-apple/pin-Apple-iPad-3-ipad-4.jpg',NULL,1,1,NULL,6383,'2018-11-29 14:56:51','2018-12-01 04:38:14'),(3,'Bai-viet/Hinh-anh-danh-muc-bai-viet/nguyen_nhan_giam_tuoi_tho_dien_thoai.jpg',NULL,1,0,NULL,4581,'2018-12-01 16:54:45','2018-12-01 17:19:21'),(4,'Bai-viet/Hinh-anh-danh-muc-bai-viet/thay_the_man-hinh_cam_ung.jpg',NULL,1,0,NULL,3069,'2018-12-01 18:24:44','2018-12-01 18:24:44');

/*Table structure for table `st_post_category` */

DROP TABLE IF EXISTS `st_post_category`;

CREATE TABLE `st_post_category` (
  `post_id` int(11) unsigned NOT NULL,
  `category_id` int(11) unsigned NOT NULL,
  UNIQUE KEY `post_id` (`post_id`,`category_id`),
  KEY `fk_post_id` (`post_id`),
  KEY `fk_category_id` (`category_id`),
  CONSTRAINT `fk_post_category_cateid` FOREIGN KEY (`category_id`) REFERENCES `st_category` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `fk_post_category_postid` FOREIGN KEY (`post_id`) REFERENCES `st_post` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `st_post_category` */

insert  into `st_post_category`(`post_id`,`category_id`) values (2,555);

/*Table structure for table `st_post_translations` */

DROP TABLE IF EXISTS `st_post_translations`;

CREATE TABLE `st_post_translations` (
  `id` int(11) unsigned NOT NULL,
  `language_code` varchar(2) NOT NULL,
  `slug` varchar(255) NOT NULL,
  `title` varchar(255) NOT NULL,
  `description` mediumtext NOT NULL,
  `content` longtext NOT NULL,
  `meta_title` varchar(100) NOT NULL,
  `meta_description` varchar(170) NOT NULL,
  `meta_keyword` varchar(255) DEFAULT NULL,
  UNIQUE KEY `ap_post_translations_id_language_code_pk` (`id`,`language_code`),
  FULLTEXT KEY `title` (`title`),
  CONSTRAINT `fk_post_trans_postid` FOREIGN KEY (`id`) REFERENCES `st_post` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `st_post_translations` */

insert  into `st_post_translations`(`id`,`language_code`,`slug`,`title`,`description`,`content`,`meta_title`,`meta_description`,`meta_keyword`) values (2,'vi','bao-gio-can-thay-pin-iphone','Bao giờ cần thay pin Iphone','Pin Iphone bao lâu nên thay một lần','<p>Nếu bạn l&agrave; fan của \"nh&agrave; T&aacute;o\" th&igrave; bạn chắc chắn sẽ nhận ra một điều rằng, d&ugrave; điện thoại của bạn pin c&oacute; \"tr&acirc;u\" đến đ&acirc;u đi chăng nữa th&igrave; đến một thời gian n&agrave;o đ&oacute; tuổi thọ của pin sẽ bị suy giảm dẫn đến hiệu năng bị suy giảm theo v&agrave; cần được thay thế. C&aacute;c dấu hiệu ta thường gặp phải như:</p>\r\n<p><img src=\"/public/media/Bai-viet/Hinh-anh-danh-muc-bai-viet/bao-gia-khung-zon.jpg\" width=\"400\" height=\"300\" caption=\"false\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\r\n<p>- Thời gian hết pin nhanh</p>\r\n<p>- Nhiệt độ tỏa ra cao hơn l&uacute;c thường</p>\r\n<p>- Sạc pin chậm v&agrave;o&nbsp;</p>\r\n<p>Đ&oacute; l&agrave; những dấu hiệu cơ bản để nhận biết l&agrave; pin của bạn đ&atilde; đến l&uacute;c cần phải thay thế. Ch&iacute;nh v&igrave; thế, c&ocirc;ng ty Zin Việt Nam ch&uacute;ng t&ocirc;i đ&atilde; nghi&ecirc;n cứu v&agrave; ph&aacute;t triển ra d&ograve;ng pin điện thoại Orizin d&agrave;nh ri&ecirc;ng cho c&aacute;c d&ograve;ng pin Iphone như Iphone 5C, 5G, 5S, 6, 6S, 6 plus, 7, 7 plus,....với dung lượng chuẩn từ 1440 mAh đến 2900 mAh sẽ đem lại những trải nghiệm th&uacute; vị khi bạn sử dụng.&nbsp;</p>','Bao giờ cần thay pin Iphone','Thay pin Iphone','Bao giờ cần thay pin Iphone'),(3,'vi','nguyen-nhan-giam-tuoi-tho-cua-dien-thoai','Nguyên nhân giảm tuổi thọ của điện thoại','Nguyên nhân giảm tuổi thọ của điện thoại','<p>Bạn c&oacute; đồng &yacute; với t&ocirc;i rằng, trong thời buổi hiện nay, hầu hết ch&uacute;ng ta ai cũng c&oacute; điện thoại của ri&ecirc;ng m&igrave;nh tuy nhi&ecirc;n chỉ trong nửa năm sử dụng th&igrave; c&aacute;c sản phầm c&ocirc;ng nghệ n&agrave;y sẽ k&eacute;m hơn c&oacute; thể l&agrave; bị lỗi phần mềm hoặc hỏng ho&agrave;n to&agrave;n điều n&agrave;y kh&ocirc;ng hề dễ chịu ch&uacute;t n&agrave;o. Nhưng đa số nguy&ecirc;n nh&acirc;n l&agrave; từ ch&iacute;nh c&aacute;ch sử dụng của người sở hữu Dưới đ&acirc;y l&agrave; một số nguy&ecirc;n nh&acirc;n khiến tuổi thọ điện thoại của bạn bị giảm s&uacute;t:</p>\r\n<ol>\r\n<li><strong> </strong><strong>Nước</strong></li>\r\n</ol>\r\n<p>&nbsp;Nước v&agrave; đồ điện tử l&agrave; hai thứ kh&ocirc;ng thể dung h&ograve;a được với nhau. Nhưng hiện nay nước l&agrave; l&yacute; do nhiều nhất g&acirc;y hỏng điện thoại. Nếu như bạn l&agrave;m dơi điện thoại xuống nước đầu ti&ecirc;n h&atilde;y tắt nguồn m&aacute;y nếu như điều đ&oacute; l&agrave; c&oacute; thể v&agrave; th&aacute;o dời pin ra c&ugrave;ng đ&oacute; l&agrave; lấy hết thẻ sim v&agrave; bộ nhớ ra khỏi m&aacute;y sau tất cả bỏ hết linh kiện của m&aacute;y v&agrave;o th&ugrave;ng chứa gạo v&agrave; c&ugrave;ng hi vọng rằng mọi thứ sẽ dần kh&aacute; hơn. C&aacute;ch n&agrave;y kh&ocirc;ng mang lại hiệu quả 100%, gạo c&oacute; t&iacute;nh h&uacute;t ẩm n&oacute; sẽ gi&uacute;p bạn loại bỏ nước s&acirc;u trong m&aacute;y. Nếu bạn may mắn bạn c&oacute; thể cứu được điện thoại của bạn h&atilde;y tr&aacute;nh c&aacute;c nơi c&oacute; độ ẩm cao như nh&agrave; tắm, bể bơi, ph&ograve;ng x&ocirc;ng hơi,&hellip;</p>\r\n<ol start=\"2\">\r\n<li><strong> </strong><strong>Sạc pin</strong></li>\r\n</ol>\r\n<p>&nbsp;C&aacute;c loại m&aacute;y t&iacute;nh hay điện thoại hiện nay thường sử dụng loại pin lithium-ion hay lithium polymer. Loại pin n&agrave;y thường c&oacute; tuổi thọ từ 400-600 chu kỳ sạc (một chu kỳ sạc tương đương với việc sạc pin từ l&uacute;c 0% đến 100%). Để đảm bảo tuổi thọ cho pin l&acirc;u chai, bạn kh&ocirc;ng n&ecirc;n để cho m&aacute;y hết sạch pin rồi mới sạc. Thời gian tốt nhất để sạc pin l&agrave; l&uacute;c lượng pin chỉ c&ograve;n 10-20%. Th&oacute;i quen n&agrave;y sẽ k&eacute;o d&agrave;i tuổi thọ của pin l&ecirc;n đến 1000-1100 chu kỳ. Kh&ocirc;ng n&ecirc;n sạc qu&aacute; đầy, tốt nhất chỉ n&ecirc;n sạc pin đến 80% để đảm bảo tuổi thọ của pin. Việc sạc pin qu&aacute; l&acirc;u dễ l&agrave;m pin sinh nhiệt l&agrave;m chai pin lẫn c&aacute;c linh kiện b&ecirc;n trong m&aacute;y. Trước khi sạc bạn n&ecirc;n th&aacute;o ốp lưng ra để tr&aacute;nh cho m&aacute;y v&agrave; pin kh&ocirc;ng bị q&uacute;a n&oacute;ng. Để tăng tuổi thọ của pin th&igrave; c&aacute;ch 3 th&aacute;ng một lần bạn n&ecirc;n d&ugrave;ng cạn pin xuống 0% rồi sạc lại pin l&ecirc;n đến mức 100%</p>\r\n<ol start=\"3\">\r\n<li><strong> </strong><strong>Ch&uacute; &yacute; đến nhiệt độ thiết bị</strong></li>\r\n</ol>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Kh&ocirc;ng n&ecirc;n để điện thoại ngo&agrave;i trời qu&aacute; n&oacute;ng hay qu&aacute; lạnh, bởi nhiệt độ qu&aacute; thấp hay qu&aacute; cao cũng sẽ l&agrave;m ảnh hưởng đến m&aacute;y v&agrave; pin.</p>\r\n<ol start=\"4\">\r\n<li><strong> </strong><strong>Ch&uacute; &yacute; đến m&agrave;n h&igrave;nh thiết bị</strong></li>\r\n</ol>\r\n<p>&nbsp;&nbsp;Tr&aacute;nh để điện thoại trực tiếp dưới &aacute;nh mặt trời, bởi để m&agrave;n điện thoại qu&aacute; l&acirc;u dưới &aacute;nh nắng sẽ khiến m&agrave;u sắc hiển thị tr&ecirc;n m&agrave;n h&igrave;nh bị bạc m&agrave;u dần theo thời gian. Khi lau m&agrave;n h&igrave;nh, bạn n&ecirc;n d&ugrave;ng c&aacute;c loại vải mềm để lau. Kh&ocirc;ng n&ecirc;n d&ugrave;ng c&aacute;c loại dung dịch ch&ugrave;i k&iacute;nh, bởi chất amoniac b&ecirc;n trong dung dịch n&agrave;y sẽ v&ocirc; t&igrave;nh l&agrave;m ảnh hưởng đến m&agrave;u m&agrave;n h&igrave;nh của bạn đấy.</p>\r\n<ol start=\"5\">\r\n<li><strong> </strong><strong>Ch&uacute; &yacute; đến điều kiện nơi sử dụng </strong></li>\r\n</ol>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; Nếu trời đang mưa v&agrave; c&oacute; sấm s&eacute;t, bạn h&atilde;y ngắt ngay điện thoại, r&uacute;t ch&acirc;n sạc v&agrave; r&uacute;t lu&ocirc;n cả d&acirc;y c&aacute;p Internet. Sấm chớp c&oacute; thể ph&oacute;ng ra những d&ograve;ng điện với điện thế cực mạnh, l&agrave;m hỏng thiết bị của bạn đấy</p>\r\n<ol start=\"6\">\r\n<li><strong> </strong><strong>Vệ sinh thiết bị</strong></li>\r\n</ol>\r\n<p>&nbsp;&nbsp;&nbsp; &nbsp;Nếu bạn đặt điện thoại của m&igrave;nh v&agrave;o trong ngăn ch&iacute;nh của cặp hay t&uacute;i x&aacute;ch, c&aacute;c cổng kết nối của thiết bị c&oacute; thể sẽ bị nhiễm bẩn, điều n&agrave;y c&oacute; thể g&acirc;y ảnh hưởng đến qu&aacute; tr&igrave;nh sử dụng. Nếu muốn l&agrave;m sạch c&aacute;c vị tr&iacute; n&agrave;y th&igrave; sự lựa chọn tốt nhất cho bạn trong trường hợp n&agrave;y l&agrave; sử dụng tăm b&ocirc;ng. H&atilde;y để điện thoại của bạn ở một ngăn ri&ecirc;ng để c&oacute; thể bảo quản tốt hơn</p>','Nguyên nhân giảm tuổi thọ của điện thoại','Nguyên nhân làm giảm tuổi thọ của điện thoại','Tuổi thọ điện thoại'),(4,'vi','cach-xu-ly-man-hinh-bi-vo','Cách xử lý màn hình bị vỡ','Cách xử lý màn hình bị vỡ','<p>C&aacute;c vấn đề điện thoại bị nứt hay vỡ m&agrave;n h&igrave;nh thường bắt nguồn từ c&aacute;c sự cố lỡ tay l&agrave;m thiết bị bị dơi hay do va đập mạnh, hay do người d&ugrave;ng muốn thử độ bền của sản phẩm nhưng lại hơi hơi qu&aacute; mức một ch&uacute;t&hellip; B&ecirc;n cạnh đ&oacute;, việc m&agrave;n h&igrave;nh bị nứt cũng c&oacute; thể do c&aacute;c yếu tố ngoại cảnh như nhiệt độ thay đổi đột ngột.</p>\r\n<p>&nbsp;N&oacute;i t&oacute;m lại d&ugrave; g&igrave; đi chăng nữa th&igrave; những trường hợp tr&ecirc;n mang lại kh&ocirc;ng &iacute;t phiền to&aacute;i, kh&oacute; chịu cho người sử dụng. Trong những trường hợp đ&oacute; bạn n&ecirc;n mang ra cửa h&agrave;ng để sửa chữa cũng như thay thế nếu muốn. Bạn cũng c&oacute; thể tự m&igrave;nh mua linh kiện về thay thể, tuy nhi&ecirc;n để thay thế bạn cần phải c&oacute; kiến thức chuy&ecirc;n m&ocirc;n để sửa chữa. Nếu bạn c&oacute; &yacute; định mua mới một c&aacute;i điện thoại th&igrave; bạn c&oacute; thể thử xem. ^^</p>','Cách xử lý màn hình bị vỡ','Cách xử lý màn hình bị vỡ','Cách xử lý màn hình bị vỡ');

/*Table structure for table `st_product` */

DROP TABLE IF EXISTS `st_product`;

CREATE TABLE `st_product` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `barcode` varchar(255) DEFAULT NULL,
  `brand` int(10) unsigned NOT NULL DEFAULT 0,
  `thumbnail` varchar(255) DEFAULT NULL,
  `album` varchar(255) DEFAULT NULL,
  `data_related` varchar(255) DEFAULT NULL,
  `data_similar` varchar(255) DEFAULT NULL,
  `url_video` varchar(255) DEFAULT NULL,
  `model` varchar(50) DEFAULT NULL,
  `weight` int(11) NOT NULL DEFAULT 0,
  `quantity` smallint(6) NOT NULL DEFAULT 0,
  `price` decimal(16,0) NOT NULL DEFAULT 0,
  `price_sale` decimal(16,0) NOT NULL DEFAULT 0,
  `is_status` tinyint(2) unsigned NOT NULL DEFAULT 1 COMMENT 'trang thai',
  `is_featured` tinyint(1) NOT NULL DEFAULT 0,
  `displayed_time` datetime DEFAULT NULL COMMENT 'ngay publish',
  `viewed` int(11) unsigned NOT NULL DEFAULT 0,
  `created_time` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'ngay tao',
  `updated_time` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'ngay sua',
  PRIMARY KEY (`id`),
  FULLTEXT KEY `search_model` (`model`),
  FULLTEXT KEY `barcode` (`barcode`)
) ENGINE=InnoDB AUTO_INCREMENT=4850 DEFAULT CHARSET=utf8;

