/*Table structure for table `st_product_property` */

DROP TABLE IF EXISTS `st_product_property`;

CREATE TABLE `st_product_property` (
  `product_id` int(11) unsigned NOT NULL,
  `property_id` int(11) unsigned NOT NULL,
  UNIQUE KEY `product_id` (`product_id`,`property_id`),
  KEY `fk_product_id` (`product_id`),
  KEY `fk_property_id` (`property_id`),
  CONSTRAINT `fk_product_property_productid` FOREIGN KEY (`product_id`) REFERENCES `st_product` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `fk_product_property_proid` FOREIGN KEY (`property_id`) REFERENCES `st_property` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `st_product_property` */

/*Table structure for table `st_product_translations` */

DROP TABLE IF EXISTS `st_product_translations`;

CREATE TABLE `st_product_translations` (
  `id` int(11) unsigned NOT NULL,
  `language_code` varchar(2) NOT NULL,
  `slug` varchar(255) NOT NULL,
  `title` varchar(255) NOT NULL,
  `description` mediumtext DEFAULT NULL,
  `content` longtext DEFAULT NULL,
  `meta_title` varchar(100) DEFAULT NULL,
  `meta_description` varchar(170) DEFAULT NULL,
  `meta_keyword` varchar(255) DEFAULT NULL,
  UNIQUE KEY `ap_product_translations_id_language_code_pk` (`id`,`language_code`),
  KEY `index_slug` (`slug`),
  FULLTEXT KEY `fulltextsearchproduct` (`title`),
  FULLTEXT KEY `search_tags` (`meta_keyword`),
  CONSTRAINT `fk_product_trans_productid` FOREIGN KEY (`id`) REFERENCES `st_product` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `st_product_translations` */

