/*Table structure for table `st_users` */

DROP TABLE IF EXISTS `st_users`;

CREATE TABLE `st_users` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `oauth_uid` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `oauth_provider` varchar(50) CHARACTER SET utf8 DEFAULT NULL,
  `ip_address` varchar(45) CHARACTER SET utf8 NOT NULL,
  `username` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `password` varchar(255) CHARACTER SET utf8 NOT NULL,
  `salt` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `gender` tinyint(1) DEFAULT 0,
  `email` varchar(254) CHARACTER SET utf8 NOT NULL,
  `activation_code` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  `forgotten_password_code` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  `forgotten_password_time` int(11) unsigned DEFAULT NULL,
  `remember_code` varchar(40) CHARACTER SET utf8 DEFAULT NULL,
  `created_on` int(11) unsigned NOT NULL,
  `last_login` int(11) unsigned DEFAULT NULL,
  `active` tinyint(1) unsigned DEFAULT NULL,
  `fullname` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `first_name` varchar(50) CHARACTER SET utf8 DEFAULT NULL,
  `last_name` varchar(50) CHARACTER SET utf8 DEFAULT NULL,
  `phone` varchar(20) CHARACTER SET utf8 DEFAULT NULL,
  `created_time` datetime DEFAULT current_timestamp(),
  `updated_time` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `avatar` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `shipping_address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Địa chỉ giao hàng',
  `address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `ac_address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Địa chỉ agency',
  `ac_shipping` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Địa chỉ nhận giao hàng',
  `ac_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Tên đại lý',
  `ac_is_status` tinyint(1) DEFAULT 2 COMMENT '2: Chưa được duyệt 1: Đã duyệt',
  `ac_hotline` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  `ac_business` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Lĩnh vực kinh doanh',
  PRIMARY KEY (`id`),
  FULLTEXT KEY `FULLTEXT` (`username`)
