/*Table structure for table `st_users_favourites` */

DROP TABLE IF EXISTS `st_users_favourites`;

CREATE TABLE `st_users_favourites` (
  `account_id` int(11) unsigned NOT NULL,
  `product_id` int(11) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL DEFAULT 0,
  `created_time` datetime NOT NULL DEFAULT current_timestamp(),
  UNIQUE KEY `unique` (`account_id`,`product_id`),
  KEY `pk_userfavourite_proid` (`product_id`),
  CONSTRAINT `pk_userfavourite_proid` FOREIGN KEY (`product_id`) REFERENCES `st_product` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

