/*Table structure for table `st_voucher` */

DROP TABLE IF EXISTS `st_voucher`;

CREATE TABLE `st_voucher` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `value` varchar(255) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT 'Phần trăm khuyến mãi',
  `title` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `start_time` date DEFAULT NULL,
  `end_time` date DEFAULT NULL,
  `total_use` int(11) DEFAULT 0 COMMENT 'Số lần áp dụng cho voucher. =0 là không giới hạn số lần áp dụng',
  `is_status` tinyint(2) DEFAULT 1 COMMENT '1: trạng thái public 2: Hủy',
  `created_time` datetime DEFAULT current_timestamp(),
  `updated_time` datetime DEFAULT current_timestamp(),
  `user_use` int(11) DEFAULT NULL COMMENT 'Gán cho user nào ăn',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

